import React, { useState } from 'react';
import { Link, Route, Routes, Outlet, Navigate, useLocation } from 'react-router-dom';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import SettingsOutlinedIcon from '@mui/icons-material/SettingsOutlined';
import Box from '@mui/material/Box';
import Tab from '@mui/material/Tab';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
import TabPanel from '@mui/lab/TabPanel';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import Leftbar from '../component/Leftbar';
import explorePic1 from '../component/assets/ExplorePics/explorePic1.avif';
import explorePic2 from '../component/assets/ExplorePics/explorePic2.avif';
import explorePic4 from '../component/assets/ExplorePics/explorePic4.avif';
import explorePic5 from '../component/assets/ExplorePics/explorePic5.avif';
import explorePic6 from '../component/assets/ExplorePics/explorePic6.avif';
import boy from '../component/assets/Ezz.png';
import './Pagesstyle.css';

export default function Profile() {
  const [value, setValue] = React.useState('1');

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const itemData = [
    {
      img: explorePic1,
      title: 'random img',
    },
    {
      img: explorePic2,
      title: 'random img',
    },
    {
      img: explorePic4,
      title: 'random img',
    },
    {
      img: explorePic5,
      title: 'random img',
    },
    {
      img: explorePic6,
      title: 'random img',
    },
  ];

  return (
    <div id="profile">
      <Leftbar></Leftbar>
      <div id="top">
        <Avatar id="img" sx={{ width: 160, height: 160 }} src={boy} />
        <h2 id="name">Ezz_Kalash</h2>
        <Button id="butt" variant="contained">
          Edit Profile
        </Button>
        <Button id="butt" variant="contained">
          View actions
        </Button>
        <img src={SettingsOutlinedIcon} alt="" />

        <div id="stats">
          <p id="p">5 Posts</p>
          <p id="p">211 follower</p>
          <p id="p">300 Following</p>
        </div>
        <div id="bio">
          <p id="p">ezzalden kalash</p>
          <p id="p">CSE | AAUP</p>
        </div>
      </div>
      <div className="profile_posts">
        <Box sx={{ width: '100%' }}>
          <TabContext value={value}>
            <TabList
              onChange={handleChange}
              aria-label="lab API tabs example"
              style={{ display: 'flex', justifyContent: 'center' }}
            >
              <Tab value="1" label="Posts" sx={{ color: 'white', paddingRight: 10, paddingLeft: 10 }} />
              <Tab value="2" label="Reels" sx={{ color: 'white', paddingRight: 10, paddingLeft: 10 }} />
              <Tab value="3" label="Tagged" sx={{ color: 'white', paddingRight: 10, paddingLeft: 10 }} />
            </TabList>
            <Outlet />
          </TabContext>
        </Box>
      </div>
    </div>
  );
}
